------------------------------- MAP DUMP --------------------------------

-- Setting the Room
local GoatMount = Room.new("GoatMount")
local roomWidth, roomHeight = 200, 80
GoatMount:resize( roomWidth * 16, roomHeight * 16)

-- Setting the Tiles
local layers = 
{
	{
		tileset = Sprite.find( "Tile16Snow" , "Vanilla" ),
		depth = 12
	},
	{
		tileset = Sprite.find( "Tile16Snow" , "Vanilla" ),
		depth = 11
	},
	{
		tileset = Sprite.find( "Tile16Snow" , "Vanilla" ),
		depth = -9
	},

}

local specialLayers = 
{
	Object.find( "B" , "Vanilla" ),
	Object.find( "BNoSpawn" , "Vanilla" ),
	Object.find( "BNoSpawn2" , "Vanilla" ),
	Object.find( "BNoSpawn3" , "Vanilla" ),
	Object.find( "Geyser" , "Vanilla" ),

}

local tiles = {}

for _, layer in ipairs( layers ) do
	local tileset = layer.tileset
	
	local currentTile = nil
	
	local existingTile = Sprite.find( tileset:getName() .. "_tile" )
	
	if not existingTile then
		for hi = 0, math.ceil( tileset.height / 16 ) - 1 do
			for wi = 0, math.ceil( tileset.width / 16 ) - 1 do
				local imageSurface = Surface.new( 16 , 16 )
				
				graphics.setTarget( imageSurface )
				imageSurface:clear()
				
				graphics.drawImage{
					image = tileset,
					x = 0 - ( wi * 16 ) + tileset.xorigin,
					y = 0 - ( hi * 16 ) + tileset.yorigin
				}

				graphics.resetTarget()
				
				if currentTile then
					currentTile:addFrame( imageSurface )
				else
					currentTile = imageSurface:createSprite( 0 , 0 )
				end
				
				imageSurface:free()
				
			end
		end
		local newTile = currentTile:finalise( tileset:getName() .. "_tile" )
		tiles[tileset] = newTile
	else
		tiles[tileset] = existingTile
	end
end

