local stripWidth = 1008

for index, layer in ipairs( layers ) do
	local tileSprite = tiles[ layer.tileset ]
	local tileData = tileGridRaw[ index ]
	local tileGrid = {}
	
	for data in string.gmatch( tileData , "([^".."$".."]+)") do
		local preGrid = {}
		for value in string.gmatch( data , "([^"..".".."]+)") do
			table.insert( preGrid , tonumber(value) )
		end
		table.insert( tileGrid , { frame = preGrid[1] , x = preGrid[2] , y = preGrid[3] } )
	end
	
	layer.images = {}
	for i = 1, math.ceil( ( roomWidth * 16 ) / stripWidth ) do
		local imageSurface = Surface.new( math.min( roomWidth * 16 , stripWidth) , roomHeight * 16 )
		
		graphics.setTarget( imageSurface )
		imageSurface:clear()
		
		for _, tile in pairs( tileGrid ) do
			if tile.x * 16 >= ( ( i - 1 ) * stripWidth ) and tile.x * 16 < ( i * stripWidth ) then
				graphics.drawImage{
					image = tileSprite,
					subimage = tile.frame,
					x = tile.x * 16 - ( i - 1 ) * stripWidth,
					y = tile.y * 16
				}
			end
		end
		
		graphics.resetTarget()
		
		local stageImage = imageSurface:createSprite( 0 , 0 )	
		layer.images[i] = stageImage:finalise( "GoatMount"..index.."_"..i )
		imageSurface:free()
	end
end

for index, object in ipairs( specialLayers ) do
	local tileObject = object
	local tileData = specialGridRaw[ index ]
	local tileGrid = {}
	
	for data in string.gmatch( tileData , "([^".."$".."]+)") do
		local preGrid = {}
		for value in string.gmatch( data , "([^"..".".."]+)") do
			table.insert( preGrid , tonumber(value) )
		end
		table.insert( tileGrid , { x = preGrid[1] , y = preGrid[2] } )
	end
	
	for _, tile in pairs( tileGrid ) do
		GoatMount:createInstance( tileObject , tile.x * 16 , tile.y * 16 )
	end
end

local function drawStage( handler )
	for _, layer in ipairs( layers ) do
		if layer.depth == handler.depth then
			for index, strip in ipairs( layer.images ) do
				graphics.drawImage{
					image = strip,
					x = (index - 1) * stripWidth,
					y = 0
				}
			end
		end
	end
end

callback.register( "onStageEntry" , function()
	local room = Room:getCurrentRoom()
	if room == GoatMount then
		obj.Geyser:create(1765, 1008)
		for _, layer in ipairs( layers ) do
			graphics.bindDepth( layer.depth , drawStage )
		end
	end
end )

return GoatMount